import React,{useState} from "react";
import { Link, useHistory } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { signOut } from "../redux/action-creators";
import {Nav,Logo,Hamburger,Menu,MenuLink} from './styled/Navbar.style'

const Navbar = () => {
  const dispatch = useDispatch();
  const history = useHistory();
  const { currentUser } = useSelector((state) => state.authenticationReducer);
  const handleSignOut = () => {
    dispatch(signOut(history));
  };
  const [isOpen, setIsOpen] = useState(false);
  return (
    <Nav>
      <Logo href="">
        Eli<span>Codes</span>
      </Logo>
      <Hamburger onClick={() => setIsOpen(!isOpen)}>
        <span />
        <span />
        <span />
        <span />
        <span />
        <span />
        <span />
        <span />
        <span />
      </Hamburger>
      <Menu isOpen={isOpen}>
        <MenuLink href="/">Home</MenuLink>
        <MenuLink href="/createmovie">Create Movies</MenuLink>
        <MenuLink href="/deletemovie">Delete Movies</MenuLink>
        <MenuLink href="/signup">Sign Up</MenuLink>

        {currentUser !== null ? (

        <MenuLink href="/" onClick={handleSignOut} >Sign Out</MenuLink>
        ) : (
        <MenuLink href="/signin">Sign In</MenuLink>
        )}


      </Menu>
    </Nav>
  );
};

export default Navbar;
